  true,\n\t\"url\": null,\n\t\"notes\": \"FAVSIS supports Flight Standards Service
  (AFS) by maintaining their information on entities such as air carriers, air agencies,
  designated airmen, and check airmen. FAVSIS also allows Aviation Safety Inspectors
  (ASIs) to store, retrieve, and report on results of their inspections related to
  aviation safety for air carriers, air agencies, and other entities. FAVSIS is the
  system of record for this data.  FAVSIS interacts with users via a front-end web
  interface.FAVSIS has replatformed the Project Tracking and Reporting Subsystem (PTRS),
  Vital Information Subsystem (VIS) and the SPAS and Rehost (ETL system for Upload/Download
  data from eFSAS).\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
